import { useEffect } from 'react';
import {
  createElement,
  loadAirwallex,
  ElementType
} from 'airwallex-payment-elements';

const intent_id = 'int_n10tqMpQzvI20pwBQzIACXXqUZo';
const client_secret = 'eyJhbGciOiJIUzI1NiJ9.eyJpYXQiOjE2MDkzOTI4MDcsImV4cCI6MTYwOTM5NjQwNywiYWNjb3VudF9pZCI6IjZkMzljOGU3LWQyY2EtNGQ0Yy04N2I5LWIzY2Y3MzNkNTU2ZSIsImRhdGFfY2VudGVyX3JlZ2lvbiI6IlVLIiwiaW50ZW50X2lkIjoiaW50X24xMHRxTXBRenZJMjBwd0JReklBQ1hYcVVabyJ9.yszCObRTB-dcyWFVXBb4GqrVgVqKAYH5Cah3a7vsqxI';
const ELEMENT_TYPE: ElementType = 'dropIn';

function dropin() {
  useEffect(() => {
    loadAirwallex({
      env: 'staging',
      origin: window.location.origin
    }).then(()=>{
      console.log('loaded airwallex');
    })
    .then(()=>{
      createElement(ELEMENT_TYPE, {
        intent: {
          id: intent_id,
          client_secret: client_secret
        }
      })?.mount(ELEMENT_TYPE);
    })

    const onSuccess = (event: CustomEvent) => {
      /*
        ... Handle event
      */
      console.log(`Confirm success with ${JSON.stringify(event.detail)}`);
    };

    window.addEventListener('onSuccess', onSuccess as EventListener);
    return () => {
      window.removeEventListener('onSuccess', onSuccess as EventListener);
    };
  })

  return (
    <div>
      <h2>DropIn Integration</h2>
      <div id={ELEMENT_TYPE}></div>
    </div>
  )
}

export default dropin;
